  \"\",\n\t\t\"description\": \"A map service on the www depicting surface management
  agency lines which are the surveyed boundary lines for which the Forest Service
  is responsible for making and posting. These include the boundaries between NFS
  lands and non-NFS lands and the boundaries of congressionally designated areas such
  as National Wilderness. The purpose of this map service is to allow national forest
  system boundary managers to query and report on the status of these boundaries for
  planning boundary management and maintenance work, and to provide this information
  to anyone else needing this information for analysis, querying, reporting, mapping.
  The lines should indicate the current status of the physical marked and posted lines
  in the field, and their maintenance status. The purpose of the data is to provide
  display, identification, and analysis tools for determining current boundary information
  for Forest Service managers, GIS Specialists, and others. \",\n\t\t\"format\": \"HTML\",\n\t\t\"tracking_summary\":
